import React,{useState,useEffect} from "react";



const Trader = ()=>{
    const products = [
        {trade_id: 1, client: 'Shoes',instrument: 'Running Shoes.',quantity:"asdasd",direction:"asdasd" },
        {trade_id: 1, client: 'Shoes',instrument: 'Running Shoes.',quantity:"asdasd",direction:"asdasd" },
    ];
    const [data,setData] = useState(products)
   
    let rows;

    useEffect(()=>{
        fetch("/selectTr",{
            method:"GET",
            
        }).then(
            res=>res.json()
        ).then(data=>{
            console.log(data)
           
            setData(data.end)
        })
    },[])
        
    
    
    return (
        <div className="table-div">
            <table >
                <thead>
                <tr>
                <th>trade_id</th>
                <th>client</th>
                <th>instrument</th>
                <th>quantity</th>
                <th>direction</th>
            </tr>
                </thead>
                <tbody>
                {data.map(home => <tr>
            <th>{home.trade_id}</th>
            <th client>{home.client}</th>
            <th instrument>{home.instrument}</th>
            <th quantity>{home.quantity}</th>
            <th direction>{home.direction}</th>
         </tr>)}
                </tbody>
            </table>
           
        </div>
        // <Table data={data}/>
   )
}

export default Trader
